export default {
    en: {
        //Navbar
        'nav.reservation': 'Reservation',
        'nav.prices': 'Prices',
        'nav.contacts': 'Contacts',

        //Home
        'home.intro': 'Situé à Ashdod, le pressing The Cleaners met ses services à votre disposition dans la gestion de vos vêtements et votre linge. Nous avons à cœur la satisfaction de nos clients et leur proposons des services de lavage et de repassage adaptés à leur besoin. Vous n’avez plus à vous soucier de votre linge, nous nous en chargeons à votre place et à des prix imbattables.',
        'home.button': 'Order a delivery',
    },
    fr: {
        //Navbar
        'nav.reservation': 'Reservation',
        'nav.prices': 'Tarifs',
        'nav.contacts': 'Contacts',

        //Home
        'home.intro': 'Located in Ashdod, Laundry The Cleaners offers its services in the management of your clothes and linen. We care about the satisfaction of our customers and offer them washing and ironing services adapted to their needs. You no longer have to worry about your laundry, we take care of it for you and at unbeatable prices.',
        'home.button': 'Reservez une livraison',
    },
    he: {
        //Navbar
        'nav.reservation': 'הסתייגויות',
        'nav.prices': 'מחירים',
        'nav.contacts': 'קשר',

        //Home
        'home.intro': 'ממוקם באשדוד, מכבסה את השירותים מציעה את שירותיה של הבגדים שלך ואת פשתן. אכפת לנו מהסיפוק של הלקוחות שלנו ומציעים להם שירותי כביסה וגיהוץ המותאמים לצרכיהם. אתה כבר לא צריך לדאוג כביסה שלך, אנחנו מטפלים בזה בשבילך במחירים ללא תחרות.',
        'home.button': 'Book a delivery',
    }
}
